import './App.css';
import NavBar from './components/NavBar';
import TestimonalCard from './components/TestimonialSlider';
import Slider from "react-slick"
import testimonials from './components/testimonials';

function cards(testimonials) {
  return (
    <TestimonalCard
      id={testimonials.id}
      name={testimonials.name}
      message={testimonials.message}
    />
  )
}

function App() {
  const settings = {
    dots: true,
    fade: true,
    autoplay: true,
    infinite: true,
    speed: 500,
    autoplayspeed: 5000,
    slidestoShow: 1,
    SlidestoScroll: 1
  }
  return (
    <div>
      <NavBar />
      <div>
        <h1>Testimonials</h1>
        <Slider {...settings}>{testimonials.map(cards)}</Slider>
      </div>
    </div>
  );
}

export default App;
